import React from 'react';
import './Subtotal.css';
import CurrencyFormat from 'react-currency-format';
import { SportsBasketball } from '@mui/icons-material';

function Subtotal() {
  return (
    <div className='subtotal'>
        <CurrencyFormat
          renderText={(value) => (
            <>
              <p>
                Subtotal ({basket.length} items):
                <strong>{'${value}'}</strong>
              </p>
              <></>
            </>
          )}  
        />
    </div>
  )
}

export default Subtotal
